import React from "react";

function UserWishs(props) 
{
  const wish = [props.wishs[0], props.wishs[1], props.wishs[2]]
  const listItems = wishs.map((w) => 
    <li key={w.id}><a href={"https://localhost:3000/Wish/"+w.userId}>{w.present}</a></li>      
  );

  return (
      <div className="UserWishs">
        {listItems}
      </div>
    );
  }
  
  export default UserWishs;
